import React from 'react';
import { Navigate, useNavigate } from 'react-router-dom';
import RegisterForm from '../components/RegisterForm';

function Register () {
  const navigate = useNavigate();

  return <>
    <h1>Register</h1>
    <RegisterForm success={() => {
      navigate('/quiz/new');
    }}/>
  </>;
}
export default Register;
